import React from 'react'

function Sidebar({topanime}) {
    return (
        <aside>
               <h3>top <span>10</span> animes</h3>
           <nav className="navFlex">
               {topanime.map(anime=>(
               <a href={anime.url} target="_blank" rel="noreferrer" key={anime.mal_id}>
                {anime.title}
               </a>          
               ))}
           </nav>
        </aside>
    )
}

export default Sidebar
